import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';
import Message from "./Message";




const Messages = (props) => {

	let messageArr = [
		{ id: 0, message: "lorem" },
		{ id: 1, message: "Lorem ipsum dolor sit amet." },
		{ id: 3, message: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Modi, nobis mollitia?" }
	]
	
	let messageNew = messageArr.map( m =>
		<Message message={m.message} />
		);

	return (
		<div>
			<h2>Чат</h2>
			<div>
				{messageNew}
			</div>
		</div>
	);
}

export default Messages;
